import { ADD_TO_CART,REMOVE_FROM_CART } from "./constant";

export const addToCart = (item) => {
    console.warn(" aaaction is called", item)
    return {
        type: ADD_TO_CART,
        item
    }
}

export const removefromCart = (id) => {
    console.warn("action is called", id)
    return {
        type:REMOVE_FROM_CART,
        id
    }
}
